import React from 'react'
import { BrowserRouter as Router, useHistory} from "react-router-dom";


export default function RedirectButton(props){
    const history = useHistory()
    const Redirect =()=>{
        history.push({
            pathname: "/Details",
            search: '?Details',
            state: { movieData: props.movieData}
        })
    }
    return(
        <div> 
            <p>Title: </p>
            <p>Year:{this.state.data.Year}</p>           
            <button className = "btnn" onClick = {Redirect} >View Details</button>
        </div>
        )
            
}
